It was my first time to wear the traditional style BINGATA(Ryuso).

It is completely different compared to Japanese Kimono style(Waso). I love both of them because we can enjoy the different beauty❤️🧡💛💚💙💜

In next year my BINGATA life will be 10th anniversary.

I try to keep dyeing BINGATA with the good health for all of my life🥰

