初めての琉装にプロのメイクさん💄とってもドキドキしました💓

お着物(和装)と全然違った着方で驚いたし、かつらと紅型の衣装が思っていた以上に重かったです。琉装も和装もそれぞれの美しさがあって大好きです❤️💚💛💜🧡💙

来年わたしの紅型生活は10周年を迎えます。なるべく健康でこの命が終わるときまで紅型を染め続けたいです。健康第一👍✨

